import React from 'react';
import { Button } from 'react-bootstrap';


const VacationButton = () => {

  return (
    <>
      <div className="pb-2">
        <div>
          <button className="btn-disabled px-4">
            <div className="btn-disabled">
              휴가 신청 내역
            </div>
          </button>
        </div>
        {/* <Button variant="outline-secondary" className="me-3">휴가 신청 내역</Button> */}
        <Button variant="primary">휴가사용</Button>
      </div>
    </>
  )
}

export default VacationButton;
